import './App.css';
import { BrowserRouter, Routes , Route } from 'react-router-dom'
import Home from '../pages/Home';
function Homepage() {
  return (
    <BrowserRouter>
    <div className="App">
        <Header />  
        <Routes>
          <Route path='/' element={<Home />}></Route>
          {/* <Route path='products' element={<Products />}></Route> */}
        </Routes>    
    </div>
    </BrowserRouter>
  );
}

export default Homepage;
